import React from 'react';
//import { CheckboxData } from '../../types/checkbox-data';
import { useAppDispatch } from '../../../hooks/hooks';
import { setDataToPostTransport } from '../../../store/app-slice';
import './checkboxes.module.scss';
/*
type CheckboxesProps = {
    checkboxesData: CheckboxData;
};
*/
const hobbies = [
    { value: 'Спортзал' },
    { value: 'Кальян' },
    { value: 'Диван' },
    { value: 'Onfoot' },
];

const music = [
    { value: 'Спортзал', },
    { value: 'Кальян', },
    { value: 'Диван', },
    { value: 'Onfoot', },
];

const food = [
    { value: 'Спортзал', },
    { value: 'Кальян', },
    { value: 'Диван', },
    { value: 'Onfoot', },
];



/*
function Checkboxes({ checkboxesData }: CheckboxesProps): JSX.Element {
    const { music, food, } = checkboxesData;
*/
function Checkboxes() {
    const dispatch = useAppDispatch();

    return (
        <div>
        <ul className="checkbox__list">
            {hobbies.map(({ value }) => (
                <li className="checkbox__item" key={value}>
                    <div className="checkbox__checkbox">
                        <label className="checkbox-transport__label">
                            <input
                                className="checkbox-transport__input"
                                type="checkbox"
                                value={value}
                                name={value}
                                onClick={(evt) => dispatch(setDataToPostTransport(evt.currentTarget.name))}
                            />
                        </label>
                    </div>
                </li>
            ))}
        </ul>
        <ul className="checkbox__music">
            {music.map(({ value }) => (
                <li className="checkbox-transport__item" key={value}>
                    <div className="checkbox-transport__checkbox">
                        <label className="checkbox-transport__label">
                            <input
                                className="checkbox-transport__input"
                                type="checkbox"
                                value={value}
                                name={value}
                                onClick={(evt) => dispatch(setDataToPostTransport(evt.currentTarget.name))}
                            />
                        </label>
                    </div>
                </li>
            ))}
        </ul>
        <ul className="checkbox__food">
            {food.map(({ value }) => (
                <li className="checkbox-transport__item" key={value}>
                    <div className="checkbox-transport__checkbox">
                        <label className="checkbox-transport__label">
                            <input
                                className="checkbox-transport__input"
                                type="checkbox"
                                value={value}
                                name={value}
                                onClick={(evt) => dispatch(setDataToPostTransport(evt.currentTarget.name))}
                            />
                        </label>
                    </div>
                </li>
            ))}
        </ul>
        </div>
    );
}

export default Checkboxes;
